  const toggleChat = () => setIsChatOpen(prev => !prev);

  return (
    <div className="App">
      <Header />
      <Hero />
      <Services />
      <About />
      <WhyChoose />
      <Gallery />
      <Contact />
      <Footer />
      <WhatsAppButton />

      {/* Chatbot Toggle Button */}
      <div
        onClick={toggleChat}
        style={{
          position: 'fixed',
          bottom: '20px',
          right: '20px',
          zIndex: 10000,
          width: '60px',
          height: '60px',
          borderRadius: '50%',
          backgroundColor: '#007AFF',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          color: '#fff',
          fontSize: '28px',
          cursor: 'pointer',
          boxShadow: '0 4px 12px rgba(0,0,0,0.2)',
        }}
